import React, { useState } from 'react';
import './App.css';
import Navbar from './Navbar';
import ConsoleWindow from './Console';

function Tab({ selectedTab, onTabClick }) {
  const tabs = ['Home', 'Blog', 'Experience'];

  return (
    <div>
      <ul className="tabs">
        {tabs.map((tab) => (
          <li
            key={tab}
            className={`tab ${selectedTab === tab ? 'active' : ''}`}
            onClick={() => onTabClick(tab)}
          >
            {tab}
          </li>
        ))}
      </ul>
    </div>
  );
}

function App() {
  const [activeTab, setActiveTab] = useState('Home');

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  return (
    <div className="App">
      <div className="overflow-x-hidden">
        <div className="flex justify-between">
          <div className="w-72">
            <Navbar />
            <p className="mt-10">Hi there, Shubhada here</p>
            <img src={mee} className="me" alt="Image" />
          </div>
          <div className="w-1/4 flex flex-col border-l border-gray-300">
            <Tab selectedTab={activeTab} onTabClick={handleTabClick} />
            <div className="tab-content">
              {activeTab === 'Home' && <p>Home content here.</p>}
              {activeTab === 'Blog' && <p>Blog content here.</p>}
              {activeTab === 'Experience' && <p>Experience content here.</p>}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
